import React from 'react'; 
import { Link } from 'react-router';


const header = () => {
    return (
        <header>
            <div className="logo">
                <Link to="/">
                    <img src ="assets/retrocomp.gif" alt="logoo" />
                </Link>
            </div>
            <nav>
                <ul>
                    <li>
                        Home
                    </li>
                    <li>
                        Tech
                    </li>
                    <li>
                        Travel
                    </li>
                    <li>
                        Life
                    </li>
                </ul>
            </nav>
        </header>
    ); 
}; 

export default header;
